document.addEventListener('DOMContentLoaded', function() {
    // Основные элементы
    const dimensionSwitcher = document.querySelector('.dimension-switcher');
    const dimensionToggle = document.querySelector('.dimension-switcher .toggle');
    const dimensionBtns = document.querySelectorAll('.dimension-btn');
    const header = document.querySelector('.header');
    const menuToggle = document.querySelector('.menu-toggle');
    const nav = document.querySelector('.nav');

    // Элементы презентации
    const presentationLink = document.getElementById('presentation-link');
    const modal = document.getElementById('presentation-modal');
    const closeModal = document.querySelector('.close-modal');
    const pdfEmbed = document.getElementById('pdf-embed');
    const prevPageBtn = document.querySelector('.prev-page');
    const nextPageBtn = document.querySelector('.next-page');
    const pageCounter = document.querySelector('.page-counter');

// Состояние
let currentPage = 1;
let totalPages = 6; // Установите реальное количество страниц

    // Предустановленный PDF в base64 (замените на ваш реальный PDF)
    // Предустановленный PDF в base64
const defaultPDF = "data:application/pdf;base64,"

    // Инициализация
    setupEventListeners();

    function setupEventListeners() {
        // Переключение измерений
        if (dimensionSwitcher) {
            dimensionSwitcher.addEventListener('click', toggleDimension);
        }

        dimensionBtns.forEach(btn => {
            btn.addEventListener('click', function() {
                const dimension = this.dataset.dimension;
                switchDimension(dimension);
            });
        });
        function showPresentation(e) {
    e.preventDefault();
    modal.style.display = 'block';
    document.body.style.overflow = 'hidden';
    
    // Загружаем PDF
    pdfEmbed.src = `${defaultPDF}#page=${currentPage}`;
    updateCounter();
}

function hidePresentation() {
    modal.style.display = 'none';
    document.body.style.overflow = '';
}

function showPrevPage() {
    if (currentPage > 1) {
        currentPage--;
        pdfEmbed.src = `${defaultPDF}#page=${currentPage}`;
        updateCounter();
    }
}

function showNextPage() {
    if (currentPage < totalPages) {
        currentPage++;
        pdfEmbed.src = `${defaultPDF}#page=${currentPage}`;
        updateCounter();
    }
}

function updateCounter() {
    pageCounter.textContent = `Страница ${currentPage} из ${totalPages}`;
}

// Назначение обработчиков
presentationLink.addEventListener('click', showPresentation);
closeModal.addEventListener('click', hidePresentation);
prevPageBtn.addEventListener('click', showPrevPage);
nextPageBtn.addEventListener('click', showNextPage);

// Закрытие по клику вне окна
window.addEventListener('click', function(event) {
    if (event.target === modal) {
        hidePresentation();
    }
});

        // Меню
        if (menuToggle) {
            menuToggle.addEventListener('click', toggleMenu);
        }

        // Презентация
        if (presentationLink) {
            presentationLink.addEventListener('click', showPresentation);
        }

        if (closeModal) {
            closeModal.addEventListener('click', hidePresentation);
        }

        // Навигация по страницам PDF
        if (prevPageBtn) prevPageBtn.addEventListener('click', showPrevPage);
        if (nextPageBtn) nextPageBtn.addEventListener('click', showNextPage);

        // Закрытие по клику вне модального окна
        window.addEventListener('click', function(event) {
            if (event.target === modal) {
                hidePresentation();
            }
        });
    }

    function toggleDimension() {
        dimensionSwitcher.classList.toggle('active');
        dimensionToggle.classList.toggle('active');
        document.body.classList.toggle('dimension-3d');
    }

    function switchDimension(dimension) {
        dimensionBtns.forEach(btn => btn.classList.remove('active'));
        document.querySelector(`.dimension-btn[data-dimension="${dimension}"]`).classList.add('active');

        if (dimension === '3d') {
            dimensionSwitcher.classList.add('active');
            document.body.classList.add('dimension-3d');
        } else {
            dimensionSwitcher.classList.remove('active');
            document.body.classList.remove('dimension-3d');
        }
    }

    function toggleMenu() {
        menuToggle.classList.toggle('active');
        nav.classList.toggle('active');
        document.body.style.overflow = nav.classList.contains('active') ? 'hidden' : '';
    }

    function showPresentation(e) {
        e.preventDefault();
        modal.style.display = 'block';
        document.body.style.overflow = 'hidden';
        
        // Загружаем предустановленный PDF
        pdfEmbed.src = `${defaultPDF}#page=${currentPage}`;
        updateCounter();
    }

    function hidePresentation() {
        modal.style.display = 'none';
        document.body.style.overflow = '';
    }

    function showPrevPage() {
        if (currentPage > 1) {
            currentPage--;
            pdfEmbed.src = `${defaultPDF}#page=${currentPage}`;
            updateCounter();
        }
    }

    function showNextPage() {
        if (currentPage < totalPages) {
            currentPage++;
            pdfEmbed.src = `${defaultPDF}#page=${currentPage}`;
            updateCounter();
        }
    }

    function updateCounter() {
        if (pageCounter) {
            pageCounter.textContent = `Страница ${currentPage} из ${totalPages}`;
        }
    }

    // Инициализация переключателя измерений
    switchDimension('2d');
});